(1, -1, 1, '1', 'Frontpage', 1, 0, '', '1', '0', '0', 'frontpage3', 'catalog_frontpage_headline2_uber|TS_newsflash|', 'uberHotel BETA |Welcome to uberHotel - powered by Snowlight.|Check our current rare >>|How do I get Credits easily?|1. Always ask permission from the bill payer first.\r\n2. Send HABBO in UK SMS to 78881. You''ll get an SMS back with a voucher code and will charged $3 plus your standart UK SMS rate, normally 10p.\r\n3. Enter the code bellow to redeem 35 Credits.|Redeem a voucher code here:|Limited Offers|#FEFEFE|#FEFEFE|Click here for information  >>|http://uberhotel.org/'),
(2, -1, 5, '1', 'Furni Shop', 2, 3, '', '1', '1', '0', 'default_3x3', '', ''),
(3, -1, 10, '1', 'Uber Exchange', 6, 11, '', '1', '0', '0', 'default_3x3', 'catalog_bank_headline1_uber|catalog_bank_teaser|catalog_special_txtbg1', 'Exchange is where you can convert your Credits into a tradable currency. You can then use this currency to trade for Furni or just show off your riches in your room.|Click on an item for more details.|Refundable & Goods'),
(4, 6, 2, '1', 'Custom Rooms', 125, 0, 'club_regular', '1', '0', '0', 'default_3x3', 'catalog_header_blackhole|catalog_blackhole_teaser', 'This ingenious furni line has been created for you to create your very own custom room layouts!|Click on an item for details.'),
(5, -1, 15, '1', 'Staff Furniture', 31, 5, 'moderation_tool', '1', '1', '0', 'default_3x3', '', ''),
(6, -1, 11, '1', 'Uber Club', 75, 4, '', '1', '0', '0', 'club_buy', 'hc2_clubtitle', ''),
(7, 6, 4, '1', 'Club Shop', 75, 0, '', '1', '0', '0', 'default_3x3', 'hc2_clubtitle|catalog_hc_teaser|catalog_special_txtbg1', 'As a member of Uber Club, you can shop from this selection of exclusive items. Every now and then we will also be adding items that are currently unavailable in the regular Furni Shop as well!|Click on an item for details.|For Uber Club members only!'),
(8, 2, 92, '1', 'Windows', 63, 0, '', '1', '0', '0', 'default_3x3', 'ctlg_windows_headline1_en|ctlg_windows_teaser1_en', 'Let the sunshine in with one of our many window designs and give your room a unique, new feel. Don''t forget to watch out for the window cleaner every Tuesday! I heard he''s cheating on your Mum.|Click on an item for more details.'),
(9, 2, 79, '1', 'Teleporters', 58, 0, '', '1', '0', '0', 'default_3x3', 'catalog_doors_headline1|catalog_door_a', 'A different dimension? Another world? A new universe? ...or maybe just to the other side of the room! You can do it all with our range of teleporters. When trading, make sure you get a linking pair!|Click on an item for more details.'),
(10, 2, 78, '1', 'Summer', 57, 0, '', '1', '0', '0', 'default_3x3', 'summer|catalog_sum_teaser1', 'Are you a paddler, a swimmer or do you just like lazing on the side? It doesn''t matter with this summer range because you can do it all from your very own room! Don''t forget your sunscreen...|Click on an item for more details.'),
(11, 2, 30, '1', 'Executive', 27, 0, '', '1', '0', '0', 'default_3x3', 'catalog_exe_headline1_en|catalog_exe_teaser1_en', 'Looking for a professional, sophisticated working environment? You have arrived at the right page, sir. With our sleek range of real-leather furniture you can impress all of your customers and colleagues. Receptionist not included.|Click on an item for more details.'),
(12, 2, 53, '1', 'Lodge', 37, 0, '', '1', '0', '0', 'default_3x3', 'catalog_lodge_headline1|catalog_lodge_teaser1', 'For that time-honoured cabin effect, try Lodge. This collection is perfect for those with a no-frills, no-spills attitude to décor. Come and appreciate the natural beauty of wood in all its splintered glory.|Click on an item for more details.\r\n'),
(13, 2, 59, '1', 'Mode', 39, 0, '', '1', '0', '0', 'default_3x3', 'catalog_mode_headline1|catalog_mode_teaser1', 'Steely, cold and really quite uncomfortable. With so many colour choices Mode is no longer limited for use in the morgue! Although, after a nights sleep you sure can tell that’s where the beds came from.|Click on an item for more details.'),
(14, 5, 22, '1', 'Monthly Gifts 06 - 10', 9, 0, '', '1', '0', '0', 'default_3x3', 'catalog_club_headline1|catalog_hc_teaser|catalog_special_txtbg1', 'As a member of Uber Club, you can shop from this selection of exclusive items. Every now and then we will also be adding items that are currently unavailable in the regular Furni Shop as well!|Click on an item for details.|For Uber Club members only!'),
(15, 2, 63, '1', 'Plants', 45, 0, '', '1', '0', '0', 'default_3x3', 'catalog_plants_headline1|catalog_plants_teaser1', 'One of the most multifunctional ranges available – perhaps you need a hedge to divide your room? Or maybe a rose to brighten your day? Let''s fight global warming together, buy a Vase of Flowers.|Click on an item for more details..'),
(16, 2, 64, '1', 'Plastic', 46, 0, '', '1', '0', '0', 'plasto', 'catalog_plasto_headline1', 'Bring some colour into your puny, insignificant life (or not if you choose brown..) with our retro range of 70''s furniture. Pick the piece you want and your favourite colour and you''re ready to feel the vibes.|Click on an item for more details.'),
(17, 2, 10, '1', 'Bathroom', 17, 0, '', '1', '0', '0', 'default_3x3', 'catalog_bath_headline1|catalog_bath_teaser1', 'Dedicate an area for you and your guests to perform your morning ablutions – couple this furniture range with ''Relax'' and you''ll have a calm, modern and hygienic bathroom ready for.. well.. y''know.|Click on an item for more details.'),
(18, 2, 52, '1', 'Kitchen', 43, 0, '', '1', '0', '0', 'default_3x3', 'kitchen_header_en|kitchen_teaser_en', 'When the noodles hit the fan, you know what range to choose. Perfect for amateur cooks and professional chefs alike, we have everything you could want in your kitchen all under one roof. Don''t worry, we''ve got your splash-back covered.|Click on an item for more details.'),
(19, 2, 1, '1', 'Accessories', 11, 0, '', '1', '0', '0', 'default_3x3', 'catalog_extra_headline1|catalog_extra_teaser1', 'However you place your prized possessions, it''s the little bits that make the difference.  So, to make a difference, buy the little bits right here!|Click on an item for more details.'),
(20, 2, 82, '1', 'Trophies', 60, 0, '', '1', '0', '0', 'trophies', 'catalog_trophies_headline1', 'Are you a winner or just a little bit special? Buy yourself a trophy to reward your efforts! Whether you want gold, silver or bronze – it doesn''t matter – we have every trophy in every metal!|Click on an item for more details.'),
(21, 2, 68, '1', 'Rollers', 96, 0, '', '1', '0', '0', 'default_3x3', 'catalog_roller_headline1|catalog_teaser_rollers_en', 'Rollers make the world go round, literally. For queues, game or businesses we have the right colour choices for you! Rollers are also available in multipacks for discount prices! |Click on an item for more details.'),
(22, 2, 34, '1', 'Gallery', 47, 0, '', '1', '0', '0', 'default_3x3', 'catalog_gallery_headline1|catalog_posters_teaser1\r\n', 'From Bonnie Blonde to the Queen Mother, we''ve got every famous celebrity poster to complement our collection of scenery and other items of wall paraphernalia.|Click on an item for more information.'),
(23, 2, 70, '1', 'Rugs', 52, 0, '', '1', '0', '0', 'default_3x3', 'catalog_rugs_headline1|catalog_rugs_teaser1', 'Remember that rug your Grandma used to have? Yeah, well, we''re not on about that one you dirty pervert. All our rugs are non-slip, washable and totally lice free! Buy yours today while they''re still soft and snuggly.|Click on an item for more details.'),
(24, 2, 32, '1', 'Flags', 47, 1, '', '1', '0', '0', 'default_3x3', 'catalog_flags_headline1|catalog_flags_teaser1|catalog_special_txtbg2', 'If you''re feeling patriotic, get a flag to prove it! Our finest cloth flags will brighten up the dullest walls!|Click on an item for more details.|Flag this section for later!'),
(25, 5, 23, '1', 'Monthly Gifts 10 - 13', 75, 0, '', '1', '0', '0', 'default_3x3', 'catalog_vipclub_header|catalog_vipclub_teaser', 'As a member of Uber Club or VIP, you can shop from this selection of exclusive items. Every now and then we will also be adding items that are currently unavailable in the regular Furni Shop as well!|Click on an item for details.'),
(26, 5, 2, '1', 'Ecotron & Furnimatic', 26, 3, '', '1', '0', '0', 'default_3x3', 'catalog_recycler_headline3', 'These are the current rewards you can recieve for recycling furniture in the Ecotron.|Click on an item for more details.'),
(27, -1, 6, '1', 'Pixel Shop', 44, 3, '', '1', '1', '0', 'default_3x3', '', ''),
(28, 95, 3, '1', 'Information', 42, 3, '', '1', '0', '0', 'recycler_info', 'catalog_recycler_headline3|ctlg_ecotron_box', 'The Ecotron is a furni recycler. Get rid of old furni... what will you get in return? It''s a surprise! Become a Habbo eco-warrior. No refunds!|How to use the Ecotron?|1. Just drag 5 items from your hand to the Ecotron. One item / square. Recyclable items are marked in your inventory with an image. When you have 5 items in the boxes, click the "Recycle" button. You can now find the Ecotron prize box from your hand.\r\n\r\n2. Click the box to see its tag. Open the box, or trade it unopened. The timer shows you how long you have to wait before you can recycle more items. Check the prizes before you recycle- don''t be surprised by the surprise!'),
(29, -1, 12, '1', 'Games ', 202, 3, '', '1', '1', '0', 'default_3x3', '', ''),
(30, 3, 6, '1', 'Platinum Exchange', 146, 5, '', '1', '0', '0', 'default_3x3', 'catalog_bank_platinum_uber|catalog_bank_teaser|catalog_special_txtbg1', 'Available for easter! We''re proud to introduce the Platinum Exchange! The all new Platinum Bar just screams "Look at me world", this definitely Furni to be flaunted, in a humble way, of course.|Click on an item for more details.|Refundable & Goods'),
(31, 95, 1, '1', 'Ecotron', 7, 3, '', '1', '0', '0', 'recycler', 'catalog_recycler_headline3|ctlg_ecotron_image', 'Had enough of an old bit of furniture but don''t want to just trade it away? Get something more exciting and unique by placing 5 pieces of your old furniture in here. In return, you''ll recieve a brand new piece of furniture!|Click on an item for more details.'),
(32, 95, 2, '1', 'Rewards', 26, 0, '', '1', '0', '0', 'recycler_prizes', 'catalog_recycler_headline3', 'These are the current rewards you can recieve for recycling furniture in the Ecotron.||What are the prizes? Ecotron may contain one of these:\r\n'),
(33, 5, 3, '1', 'Limited Edition', 84, 4, '', '1', '0', '0', 'default_3x3', 'catalog_limited_headline1_en|catalog_limited_teaser', 'We''d like to welcome you to uberHotel with these limited edition items! Throw a party and have some fun - quick, before it leaves the catalogue forever!|Click on an item for details.'),
(34, 27, 5, '1', 'Hello', 35, 0, '', '1', '0', '0', 'default_3x3', 'catalog_hello_header1_en|catalog_hello_teaser1_en', 'This our exclusive noob range - only buyable with pixels. Want a bad quality, trashly, newbie looking room? You my friend, have come to the right place. Fill your room with these pieces for that authentic new user look!|Click on an item for more details.'),
(35, 27, 2, '1', 'Rentals', 51, 0, '', '1', '0', '0', 'default_3x3', 'catalog_pixelrent_headline1_en|catalog_pxl_teaser3_en', 'Suprise your guests with one of our exciting effects you can rent for you very own room! With pixels, you can rent an effect for an hour (perfect for a party!) and it will automatically disappear when the time is up. Magic, and oh so very simple!|Click on an item for more details.'),
(36, 27, 3, '1', 'Special Effects', 61, 0, '', '1', '0', '0', 'default_3x3', 'catalog_pixeleffects_headline1_en|catalog_pxl_teaser1_en', 'Want to go rollerskating, hoverboarding or glow bright green? We can make your dreams come true with our amazingly noobish effects! Buy one here and enable it on your effects menu. |Click on an item for more details.'),
(37, 27, 4, '1', 'Automobile', 16, 0, '', '1', '0', '0', 'default_3x3', 'catalog_automobile_header1_en|catalog_automobile_teaser1_en', 'Build your own race track, motorway or giant carpark (just like the M25!) with the Automobile range. We have every sign, traffic cone and traffic light we could steal from the Highways Agency!|Click on an item for more details.'),
(38, 59, 3, '1', 'Information', 42, 3, '', '1', '0', '0', 'recycler_info', 'catalog_marketplace_header_en', 'Uber Marketplace is a convenient and safe way to buy and sell items in uberHotel.|How does the Uber Marketplace work?|Selling items:\r\nYou can sell any item which is tradable by selecting the item in your inventory and clicking on ''Sell in Marketplace''. You are able to post 5 items for sale at the cost of 1 credit, if you''re a club member this items number will increase two times at same cost. You cannot use items currently in the Catalogue.\r\n\r\nBuying items:\r\nBrowse for the item you want to buy on the Marketplace Offers page and click Buy. We guarantee you''ll get the item at the cheapest price available at the moment of purchase.'),
(39, -1, 14, '1', 'Wired', 80, 3, '', '1', '1', '0', 'default_3x3', '', ''),
(40, 39, 1, '1', 'WIRED: Triggers', 81, 0, '', '1', '0', '0', 'default_3x3', 'catalog_wired_header2_en|ctlg_pic_wired_triggers', 'Triggers let you define what needs to happen for an Effect to take place. To program a Trigger, place it in a room, double click on it and set it up! You need to stack an Effect with the Trigger to make it work. Click on an item to see how the Trigger works!|Click on an item for more details.'),
(41, 39, 2, '1', 'WIRED: Effects', 82, 0, '', '1', '0', '0', 'default_3x3', 'catalog_wired_header3_en|ctlg_pic_wired_effects', ' Effects are what happens after you activate a Trigger. To program an Effect, place it in your room, double click on it and set it up! You will always need to stack a Trigger with the Effect to make it work.|Click on an item for more details.'),
(42, 39, 3, '1', 'WIRED: Conditions', 83, 0, '', '1', '0', '1', 'default_3x3', 'catalog_wired_header4_en|ctlg_pic_wired_conditions', 'Conditions are specific things that need to be done before a Trigger will work. If you want to use a Condition, you will need to stack it with a Trigger and Effect.|Click on an item for more details.'),
(43, 39, 4, '1', 'WIRED: Add-Ons', 85, 0, '', '1', '0', '0', 'default_3x3', 'catalog_wired_header5_en|ctlg_pic_wired_support_furniture|catalog_special_txtbg1_en', 'Use these simple Furni to bring extra spice to your Wired room. These are basic Furni, so you will still need Triggers, Effects and Conditions to make them work!|Click on an item for more details.|Use Triggers, Effects and Conditions to make these Furni work!'),
(44, 29, 2, '1', 'Ice Tag', 88, 0, '', '1', '0', '0', 'default_3x3', 'ice_2|iceskate', 'The fun is ON with our new game! Skate on ice and play Tag with your friends using the new Tag Pole and Ice Skating Patch! Not sure how to put on your skates? Step on an Ice Patch and you''re good to go.|Click on an item for more details.'),
(45, 29, 1, '1', 'Roller Skating', 94, 0, '', '1', '0', '0', 'default_3x3', 'catalog_rollerskates_header_en|catalog_teaser_rollerblades', 'Show off your tricks on the rink, get your derby going or just invite your friends to a good ol'' roller party! PS. the rink looks great when dressed up with some Neon or Diner Furni!|Click on an item for more details.'),
(46, 29, 4, '1', 'Freeze!', 87, 0, '', '1', '0', '0', 'default_3x3', 'catalog_freeze_en|freeze1', ' Freeze!.. and try the newest game to hit Habbo! Team up and plant snowball bombs to snap freeze your competitors. You could say it''s so cool, it''s frozen ;)|Click on an item for more details.'),
(47, 29, 5, '1', 'Battle Banzai', 78, 0, '', '1', '0', '0', 'default_3x3', 'catalog_battleBanzai_header|catalog_battleBanzai_teaser', 'Bigger, Better, Bouncier - it''s Battle Banzai! Now YOU set the rules for your own game, in your own room. You got the Banzai Power!|Click on an item for more details.'),
(48, 29, 6, '1', 'Uber Ball', 56, 0, '', '1', '0', '0', 'default_3x3', 'worldcup_header_en|worldcup_teaser_en', 'Whether you call it soccer, football or futbol... you can enjoy the game right here in Habbo! Get a ball and kick it, bounce it, pass it, control it and steal it!|Click on an item for more details.'),
(49, 59, 1, '1', 'Offers', 70, 0, '', '1', '0', '0', 'marketplace', 'catalog_marketplace_header_en', 'This page lists all the current offers of furniture people are selling on the hotel. Anything you like the look of?|Click on an item for more details.'),
(50, 59, 2, '1', 'My Sales', 71, 0, '', '1', '0', '0', 'marketplace_own_items', 'catalog_marketplace_header_en', 'This is a list of all the items you are currently selling on The Marketplace. |Click on an item for more details.'),
(51, 2, 86, '1', 'USVA', 129, 0, '', '1', '0', '0', 'default_3x3', 'catalog_header_USVA|Catalog_teaser_USVA', 'You don''t need to be in college to use this furni line!|Click on an item for more details.\r\n'),
(52, 2, 24, '1', 'Coco', 127, 0, '', '1', '0', '0', 'default_3x3', 'catalog_teaser_coco|coconew', 'Wooden yet comfortable furniture that wouldn''t look out of place in a treetop house!|Click on an item for details.'),
(53, 58, 15, '1', 'Pet Accessories', 43, 0, '', '1', '0', '0', 'default_3x3', 'catalog_pet_headline2|ctlg_pet_teaser1|catalog_special_txtbg2', 'You''ll need to take care of your pet to keep it happy and healthy. This section of the Catalogue has EVERYTHING you''ll need to satisfy your pet''s needs.|Click on an item for details.|You''ll have to share it!'),
(54, 27, 7, '1', 'Pixel Pet Accessories', 18, 0, '', '1', '0', '0', 'default_3x3', 'catalog_pet_headline2|ctlg_pet_teaser1|catalog_special_txtbg2', 'You''ll need to take care of your pet to keep it happy and healthy. This section of the Catalogue has EVERYTHING you''ll need to satisfy your pet''s needs.|Click on an item for details.|You''ll have to share it!'),
(55, -1, 4, '1', 'Seasonal Shop', 111, 5, '', '1', '1', '0', 'default_3x3', NULL, NULL),
(56, -1, 1, '1', 'Subscribe!', 98, 5, '', '0', '0', '0', 'mad_money', 'catalog_super_saver1_en|catalog_madmoney_teaser_en', 'With Super Saver you get 35 Credits and exclusive Furni each and every month for the super low price of $4.99!\r\nCredit Card required. Please ask your parents. Click Buy to find out more!|Subscribe today and start saving!'),
(57, 55, 4, '1', 'Subscriber Gifts', 98, 0, '', '1', '0', '0', 'default_3x3', 'catalog_super_saver1_en|promo_supersaver', 'Select your Super Savers exclusive Furni gift here!|Pick your gift'),
(58, -1, 7, '1', 'Pets Shop', 8, 2, '', '1', '1', '0', 'default_3x3', '', ''),
(59, -1, 8, '1', 'Marketplace', 69, 3, '', '1', '1', '0', 'default_3x3', '', ''),
(60, 2, 54, '1', 'Look & Feel', 55, 0, '', '1', '0', '0', 'spaces_new', 'look_feel_text', 'Floors, wallpapers, landscapes - get a groovy combination for your room. Use our virtual room preview below to test out the combinations before you buy. Select the design and color you like and click buy.'),
(61, 2, 87, '1', 'Valentines', 62, 0, '', '1', '0', '0', 'default_3x3', 'Valentines_header|valentines_catalog_teaser', 'Love is in the air, love for the Valentines range that is! We have every essential item you''ll need to make it feel like you actually have someone to love you. No more pretending to be a lonely geek - you can have a pixel love heart, love sofa or even love stickies - yay!|Click on an item for more details.'),
(62, 2, 12, '1', 'Bling', 93, 0, '', '1', '0', '0', 'default_3x3', 'catalog_header_bling_en|catalog_teaser_bling11', 'Wanna be de big Daddy and live in a luxxxury penthouse suite? Yeah well, we all know that won''t happen. bubble burst. How about you use some items from this range (if you can even afford them) to dress up your puny council flat instead?|Click on an item for more details.'),
(63, 2, 29, '1', 'Easter', 25, 0, '', '1', '0', '0', 'default_3x3', 'catalog_easter_headline1|catalog_easter_teaser1', 'Like chocolate? You''ll love Easter. The Easter bunny is right here awaiting his time to shine and deliver some eggy goodness. If you can''t wait, why dont you buy some sneaky Easter eggs anyway? I won''t tell if you don''t!|Click on an item for more details.'),
(64, 2, 33, '1', 'Flower Power', 73, 0, '', '1', '0', '0', 'default_3x3', 'flowerpower_header_en|flowerpower_teaser_en', 'Funny flowers at the ready people! These flowers may not look very good but atleast they smell like flowers... kinda... I wouldn''t give these to your girlfriends, they might just eat her! (unless that''s what you wanted, ofcourse...) |Click on an item for more details.'),
(65, 2, 43, '1', 'Habboween', 34, 0, '', '1', '0', '0', 'default_3x3', 'catalog_halloween_headline1|catalog_halloween_teaser_en', 'Spooky... whohohohhoooooo. If you couldn''t tell, that was my ghost impression. We all know ghouls, ghosts and vampies aren''t real but for all the free sweets, is it not worth pretending for just one night?|Click on an item for more details.'),
(66, 2, 88, '1', 'Virus & Hospital', 118, 0, '', '1', '0', '0', 'default_3x3', 'virus|virus1', 'Popular to contrary belief, there was really no "special epidemic" going around and this furniture is really no different. This is just normal NHS standard equiptment! If your looking for something cleaner, go to the private ward and visit the ''Hospital'' page. |Click on an item for more details.'),
(67, 2, 89, '1', 'Voodoo', 79, 0, '', '1', '0', '0', 'default_3x3', 'catalog_voodoo_header_en|catalog_voodoo_teaser', 'Have you always wondered about that strange man down the road who practices those suspicous rituals? or maybe that woman across the street who dances around her backgarden with a totem pole? Well, atleast you have some furniture to buy them for their next Birthday now.|Click on an item for more details.'),
(68, 2, 17, '1', 'Christmas 06', 90, 0, '', '1', '0', '0', 'default_3x3', 'catalog_xmas_headline2_en|catalog_xmas_teaser', 'Ho, ho ho! Merry Christmas! With the Christmas range your room can have that festive feel 24/7, baby! We''ve got everything for that authentic Christmas spirit - lights, trees and reindeer poo!|Click on an item for more details.'),
(69, 2, 16, '1', 'Celebration', 91, 0, '', '1', '0', '0', 'default_3x3', 'newyears|catalog_limited_teaser_en', 'Throw a party, have a bash, join in the celebration! You can even buy some fantastic fireworks for special occassions, parties or just for lulz! Snowlight accepts no responsibilty for accidents caused by the misure of virtual fireworks.|Click on an item for more details.'),
(70, 2, 27, '1', 'Diner', 204, 0, '', '1', '0', '0', 'default_3x3', 'catalog_diner_header_en|catalog_diner_teaser_en', 'Design your own 50''s Diner with this restaurant range in every single colour you could think of! This collection also features many timeless (and tasteless...) dishes for that real greasy spooon atmosphere.|Click on an item for more details.'),
(71, 2, 39, '1', 'Grunge', 32, 0, '', '1', '0', '0', 'default_3x3', 'catalog_grunge_headline1|catalog_grunge_teaser', 'Homeless, a tramp or maybe just a teenager? If you like laying on AIDS-riden mattresses you found behind your mate''s council flat, why not do it online too? Just remember the 50 credit fine for graffiting the Welcome Lounge please!|Click on an item for more details.'),
(72, 2, 36, '1', 'Glass', 29, 0, '', '1', '0', '0', 'default_3x3', 'catalog_glass_headline1|catalog_glass_teaser1', 'Recycled glass with rubber non-slip surfaces makes for a strange but professional look. Perfect for high rise buildings and offices to optimise lighting and the feel of openess and space. Don''t worry, its shatterproof safety glass!|Click on an item for more details.'),
(73, 2, 37, '1', 'Gothic', 30, 0, '', '1', '0', '0', 'default_3x3', 'catalog_gothic_headline1|catalog_gothic_teaser1', 'With this range you can recreate Doomsday, a medieval courtyard or just a really depressing church. This range suits those who lurk in the shadows and crawl out to start their day just as the sun sets. Dim candle light is perfect for those eyes that have never seen the bright light of day.|Click on an item for more details.|'),
(74, 2, 69, '1', 'Romantique', 50, 0, '', '1', '0', '0', 'default_3x3', 'catalog_romantique_headline1|catalog_romantique_teaser1', 'Found in the back of an old French warehouse this furniture was stored long ago and forgotten about until found and restored to its former glory. This collection looks great in any budoir or boutique and comes in several different colours!|Click on an item for more details.'),
(75, 2, 61, '1', 'Neon', 41, 0, '', '1', '0', '0', 'default_3x3', 'catalog_neon_header1_en|catalog_neon_teaser1_en', 'Start up the music and invite some friends over! Install some of our fabulous lights, dance floors and disco balls to get the party going. This is the right range for you party animals out there, so come and get some!|Click on an item for more details.'),
