(78, 2, 67, '1', 'Relax', 49, 0, '', '1', '0', '0', 'default_3x3', 'rela_header_en|rela_teaser_en', 'As one very knowledgeable singer once said - "Relax, take it easy". Take Mika''s advice and do exactly that - build a sanctuary of peace away from your hectic lifestyle to finally take a break and calm down.|Click on an item for more details.'),
(79, 2, 85, '1', 'Urban', 26, 0, '', '1', '0', '0', 'default_3x3', 'urban_header_en|urban_teaser_en', 'An extentsion of ''Grunge'' this range ties in perfectly for your streets, cities and council estates. Chain link fences are the future of modern British schools in rough areas - stock up before they''ve all gone I tell you!|Click on an item for more details.'),
