(118, 58, 16, '1', 'Information', 42, 2, '', '1', '0', '0', 'pets2', 'catalog_pet_headline1|ctlg_pet_note', 'Pets are inhabitants of uberHotel too, so each pet owner needs to know a bit about them. Look after your pet by looking through our key points below.||- You cannot trade or give away pets. Once you purchase them, they will be yours forever.\r\n- You can own as many as you want, but you can have no more than 5 pets per room.\r\n- You can take pets with you to other rooms, should the room owner allow you to do so.\r\n- Your pet needs to be trained before it''ll listen to your commands. By training your pets, you can gain some awesome achievements as well.'),
(119, 58, 1, '1', 'Dogs', 24, 0, '', '1', '0', '0', 'pets', 'catalog_pet_headline1|', 'Wet noses, paws, yaps and woofs! You''re about to enter the world of Habbo Dogs. An adorable and faithful servant awaits you with a wagging tail everytime they see you. Find a new friend from our ever-changing selection.|Name your Dog:|Pick a Colour:|Pick a breed:'),
