(121, 58, 3, '1', 'Crocs', 22, 0, '', '1', '0', '0', 'pets', 'catalog_pet_headline1|', 'Scaly skin, growls and snaps! You''re about to enter the world of Habbo Crocs. Security for your room or to scare your friends a trustworthy and surprisingly loving companion can be yours. Find a new friend from our ever-changing selection.|Name your Croc:|Pick a Colour:|Pick a breed:'),
(122, 58, 4, '1', 'Terriers', 66, 0, '', '1', '0', '0', 'pets', 'catalog_pet_headline1|', 'Good things come in small packages and Habbo''s Terriers are no exception!|Name your Terrier:|Pick a colour:|Pick a breed:'),
(123, 58, 5, '1', 'Bears', 68, 0, '', '1', '0', '0', 'pets', 'catalog_pet_headline1|', 'A large, heavy, mammal that walks on the soles of its feet, with thick fur and a very short tail. Fall in love with our adorable range of Bears that include the Grizzly and Polar varieties!|Name your Bear:|Pick a colour:|Pick a breed:|'),
(124, 58, 6, '1', 'Pigs', 67, 0, '', '1', '0', '0', 'pets', 'catalog_pet_headline1|', 'These little scamps were destined for the dining table until we struck a deal with a local farmer to rescue their cute pigtails! Adopt your little piglet today, all you need now is a name.|Name your Pig:|Pick a Colour:|Pick a breed:'),
(125, 58, 7, '1', 'Lion', 76, 0, '', '1', '0', '0', 'pets', 'catalog_pet_headline1|', 'Simba, is that you? Oh wait, it''s just one of Habbo''s adorable pet lions! Unlike real ones, these won''t bite your arms off. And hey, now you can tell all those girls that you''re a lion tamer, it''s not technically lying!|Name your Lion:|Choose a colour:|Choose a breed:'),
(126, 58, 8, '1', 'Rhino', 77, 0, '', '1', '0', '0', 'pets', 'catalog_pet_headline1|', 'Ever thought rhinos could be cute? Neither did we until we saw these pets released!|Name your Rhino:|Pick a Colour:|Pick a breed:'),
(127, 58, 9, '1', 'Spider', 95, 0, '', '1', '0', '0', 'pets', 'catalog_pet_headline1|', 'One of the most feared creatures in nature, and perhaps the most misunderstood. The majority of Spiders are predators with sharp fangs that inject venom into their prey- but dont worry, these spiders wont bite you! Maybe...||Name your Spider:|Select your colour/breed:'),
