(154, -1, 3, '1', 'Limited Offers', 145, 10, '', '1', '0', '0', 'default_3x3', 'catalog_limited_headline1_en|catalog_limited_teaser', 'Get this while it lasts, only available for 24 hours until it changes again!|Click on an item for more details.'),
(155, 2, 72, '1', 'School', 130, 0, '', '1', '0', '0', 'default_3x3', 'school|catalog_school_teaser', 'Sick of being told what to do? Want to be the boss of someone else for a change? Well now you can with our very own school range!|Click on an item for more details.');
INSERT INTO `catalog` (`id`, `parent_id`, `order_num`, `enabled`, `title`, `icon`, `color`, `required_right`, `visible`, `dummy_page`, `coming_soon`, `template`, `page_strings_1`, `page_strings_2`) VALUES
(156, 2, 77, '1', 'Steampunk', 180, 0, '', '1', '0', '0', 'default_3x3', 'catalog_header_steampunk|catalog_teaser_steampunk', 'Infuse your room design with the power of steam! This Steampunk line is a full set of building materials to create amazing room designs that resemble and alternate retro-futuristic universe.|Click on an item for more details.'),
(157, 2, 83, '1', 'TV Studio', 136, 0, '', '1', '0', '0', 'default_3x3', 'header_studio|teaser_studio', 'The Studio range lets YOU be your own music producer!|Click on an item for more details.'),
(158, 2, 23, '1', 'Christmas Cabin', 168, 0, '', '1', '0', '0', 'default_3x3', 'xmas11_catalog_header|xmas11_catalog_teaser_02', 'Get yourself into the Christmas spirit with our selection of festive Christmas furni! From comfy seats and fireplaces, to mount heads, we have it all!|Click on an item for more details.'),
(159, 2, 41, '1', 'Habbo Stars', 64, 0, '', '1', '0', '0', 'default_3x3', 'Stars_header|hstars_furni1', 'Shine like a star with this new series of fantastic furnis. Build a stage and light show and bluff your talent!|Click on an item for more details.'),
(160, 5, 21, '1', 'Welcome Lobby', 225, 0, '', '1', '0', '0', 'default_3x3', NULL, NULL),
(161, 5, 20, '1', 'Theatre', 225, 0, '', '1', '0', '0', 'default_3x3', NULL, NULL),
(162, 2, 21, '1', 'Christmas 11', 90, 0, '', '1', '0', '0', 'default_3x3', 'catalog_xmas_headline2_en|catalog_xmas_teaser', 'Ho, ho ho! Merry Christmas! With the Christmas range your room can have that festive feel 24/7, baby! We''ve got everything for that authentic Christmas spirit - lights, trees and reindeer poo!|Click on an item for more details.'),
(163, 5, 19, '1', 'Picnic', 225, 0, '', '1', '0', '0', 'default_3x3', NULL, NULL),
(164, 5, 18, '1', 'Lido', 225, 0, '', '1', '0', '0', 'default_3x3', NULL, NULL),
(165, 2, 44, '1', 'Habboween 11', 34, 0, '', '1', '0', '0', 'default_3x3', 'catalog_halloween_headline1|catalog_halloween_teaser_en', 'Spooky... whohohohhoooooo. If you couldn''t tell, that was my ghost impression. We all know ghouls, ghosts and vampies aren''t real but for all the free sweets, is it not worth pretending for just one night?|Click on an item for more details.'),
(166, 2, 13, '1', 'Boutique', 131, 0, '', '1', '0', '0', 'default_3x3', 'boutique_catalog_01|boutique_catalog_teaser_01', 'The boutique range is just the thing if you want to own a high end fashion store in Milan, but are on a budget.|Click on an item for more details.'),
(167, 2, 14, '1', 'Candy', 19, 0, '', '1', '0', '0', 'default_3x3', 'catalog_candy_headline1_en|catalog_candy_teaser1|catalog_special_txtbg2', 'Candy combines the cool, clean lines of the Mode collection with a softer, more soothing style. It''s urban sharpness with a hint of the feminine.|Click on an item for more details.|Relax! It''s faux-fur.'),
(168, 2, 80, '1', 'The Olympics', 162, 0, '', '1', '0', '0', 'default_3x3', 'olympicsheader|olympicsteaser', 'Upset that the Olympics is over? Well now you don''t have to be! Everything you need to create your own Olympics is in this furniture range!|Click on an item for more details.'),
(169, 2, 5, '1', 'Ancients', 170, 0, '', '1', '0', '0', 'default_3x3', 'catalog_header_ancients|jungle_furni_promo.png?', 'The Ancients found a paradise within the deep jungle, living among the trees to escape the dangers of the ground, some say they built their homes higher and higher before disappearing altogether...|Click on an item for more details.'),
(170, 5, 24, '1', 'Monthly Gifts 13', 172, 0, '', '1', '0', '0', 'default_3x3', 'hc2_clubtitle|catalog_hc_teaser|catalog_special_txtbg1', 'As a member of Uber Club, you can shop from this selection of exclusive items. Every now and then we will also be adding items that are currently unavailable in the regular Furni Shop as well!|Click on an item for details.|For Uber Club members only!'),
(171, 2, 22, '1', 'Christmas 12', 90, 0, '', '1', '0', '0', 'default_3x3', 'catalog_xmas_headline2_en|catalog_xmas_teaser', 'Ho, ho ho! Merry Christmas! With the Christmas range your room can have that festive feel 24/7, baby! We''ve got everything for that authentic Christmas spirit - lights, trees and reindeer poo!|Click on an item for more details.'),
(172, 2, 45, '1', 'Habboween 12', 34, 0, '', '1', '0', '0', 'default_3x3', 'hween12_header|hween_12_furni', 'Spooky... whohohohhoooooo. If you couldn''t tell, that was my ghost impression. We all know ghouls, ghosts and vampies aren''t real but for all the free sweets, is it not worth pretending for just one night?|Click on an item for more details.'),
(173, 2, 51, '1', 'Jetset', 92, 0, '', '1', '0', '0', 'default_3x3', 'jetset_header|jetset_yachtcomp', 'Party like a Millionaire with your own walk-in Money Vault. This collection is for Habbos who like to show off in an extreme fashion.|Click on an item for more details.'),
(174, 2, 31, '1', 'Executive White', 161, 0, '', '1', '0', '0', 'default_3x3', 'catalog_exe_headline1_en|catalog_exe_teaser1_en', 'Looking for a professional, sophisticated working environment? You have arrived at the right page, sir. With our sleek range of real-leather furniture you can impress all of your customers and colleagues. Receptionist not included.|Click on an item for more details.'),
(175, 2, 42, '1', 'Habbo Way', 160, 0, '', '1', '0', '0', 'default_3x3', 'catalog_header_habboway|catalog_teaser_habboway', 'To celebrate the launch of Habbo Way, we have a fantastic new floor furni. With it, you''ll be able to walk through the air, at least metaphorically.|Click on an item for more details.'),
(176, 2, 57, '1', 'Mayan', 171, 0, '', '1', '0', '0', 'default_3x3', 'mayan_header|mayanteaser', 'Just what you need to prove you survived the apocolypse!|Click on an item for more details.'),
(177, 39, 5, '1', 'WIRED: Sets', 84, 0, '', '1', '0', '0', 'default_3x3', 'catalog_wired_header6_en|ctlg_pic_wired_deals', 'The easiest way to get to WIRED is through the sets. These deals contain all the furniture you need to build a working WIRED combination (e.g. a password controlled door)|Click on an item for more details.'),
(178, 39, 6, '1', 'Information', 42, 0, '', '1', '0', '0', 'pets2', 'catalog_wired_header1|ctlg_pic_teaser_wired', 'WIREDs are programmable components that can perform and (optionally with conditions) trigger functions.|For Wired you need 3 types of furniture:|\r\n1. Trigger: Things that need to happen for effects to happen\r\n2. Effects: Things that happen when a trigger is activated\r\n3. Conditions (optional): What must be in order for a trigger to work\r\nSo: Trigger + Effect + (Condition) = Wired!|Each component can be programmed separately. Just stack your trigger, effect and - if you want - your condition on top of each other and they will work!'),
(179, 6, 3, '1', 'Pet Special Breeds', 173, 0, 'club_regular', '1', '0', '0', 'pets', 'catalog_pet_headline1|', 'Pets with special breed are going land on uberHotel, one every 24 hours! Don''t miss out on the chance to find a new friend! Who knows when they''ll back.||Name your Pet:|Pick a color/breed:'),
(180, 5, 10, '1', 'Pet Special Breeds', 173, 0, '', '1', '0', '0', 'default_3x3', 'catalog_pet_headline1|', 'Pets with special breed are going land on uberHotel, one every 24 hours! Don''t miss out on the chance to find a new friend! Who knows when they''ll back.||Name your Pet:|Pick a color/breed:'),
(181, 5, 5, '1', 'Black Plastic', 46, 0, '', '1', '0', '0', 'default_3x3', 'catalog_plasto_headline1_en', 'New furniture that has been imported into the database and is ready for sorting. These item are not fully functional yet - please do not harass us about this, we know they are here and waiting to be set.|Click an item for details.'),
(182, 5, 6, '1', 'Pink Plastic', 158, 0, '', '1', '0', '0', 'default_3x3', 'catalog_plasic_headline_pink1|plastic_pink_promo', 'In honor of Mother''s Day we have the final set in our Plasto Promotion- The Pink Translucent Plasto. Perfect for seeing the ground in a rosy way.|Click an item for details.'),
(183, 5, 7, '1', 'Transparent Plastic', 154, 0, '', '1', '0', '0', 'default_3x3', 'catalog_plasic_headline_transp1|plastic_transp', 'Plastic furni is aged, time has washed away its color... Saving some of these pieces, you will remember the elegant structure of plastic furni along with the memory of good old times.|Click an item for details.'),
(184, 5, 8, '1', 'Rainbow Plastic', 46, 0, '', '1', '0', '0', 'default_3x3', 'catalog_plasto_headline1_en', 'New furniture that has been imported into the database and is ready for sorting. These item are not fully functional yet - please do not harass us about this, we know they are here and waiting to be set.|Click an item for details.'),
(185, 55, 6, '1', 'Valentines 11', 62, 0, '', '1', '0', '0', 'default_3x3', 'Valentines_header|valentines_catalog_teaser', 'Love is in the air, love for the Valentines range that is! We have every essential item you''ll need to make it feel like you actually have someone to love you. No more pretending to be a lonely geek - you can have a pixel love heart, love sofa or even love stickies - yay!|Click on an item for more details.'),
(186, 55, 7, '1', 'Valentines 12', 62, 0, '', '1', '0', '0', 'default_3x3', 'Valentines_header|valentines_catalog_teaser', 'Love is in the air, love for the Valentines range that is! We have every essential item you''ll need to make it feel like you actually have someone to love you. No more pretending to be a lonely geek - you can have a pixel love heart, love sofa or even love stickies - yay!|Click on an item for more details.'),
(187, 55, 2, '1', 'Snowflake Gifts 11', 86, 0, '', '1', '0', '0', 'default_3x3', 'catalog_snowflake_en|ctlg_pic_snowflake_december', 'It''s almost Christmas so it''s time for presents! Start doing the daily Christmas Quests and you will earn special Snowflakes which you can use here to choose your gifts.|Click on an item for more details.'),
(188, 55, 5, '1', 'Summer 11', 57, 0, '', '1', '0', '0', 'default_3x3', 'summer|catalog_sum_teaser1', 'Are you a paddler, a swimmer or do you just like lazing on the side? It doesn''t matter with this summer range because you can do it all from your very own room! Don''t forget your sunscreen...|Click on an item for more details.');
